import Reacrt from 'react'
import NewLineTable from "../NewLineTable/NewLineTable";
import s from './MainData.module.css'
import Filters from "./Filters/Filters";
import {useState} from "react/cjs/react.production.min";


const MainData = (props) => {
    const [num, setNum] = useState(0)
    const firsLine = {
        id: "id",
        firstName: "firstName",
        lastName: "lastName",
        email: "email",
        phone: "phone",
        address: "address",
        description: "description"
    }
    if (props.data) {
        if (props.data.data.length <= 50) {
            let arr = props.data.data.map(tr => (<tr><NewLineTable data={tr} key={tr.id}/></tr>))
            return (
                <table>
                    <Filters data={firsLine}/>
                    {arr}
                </table>
            )
        } else {
            let arr =  props.data.data.slice(num * 50, num * 50 + 1).map(tr => (<tr><NewLineTable data={tr} key={tr.id}/></tr>))
            return (
                <table>
                    <Filters data={firsLine}/>
                    {arr}
                </table>
            )
        }
    } else {
        return <div></div>
    }
}


export default MainData
